import React from "react";



function Home() {
  return (
    <div class="container">

    <div class="row">
    <div class="col-md-4 col-lg-4">
    <h1 className="heading-home">Uber <span className="heading-eats heading-home">Eats</span></h1>
    </div>
    // eslint-disable-next-line</div>
    // eslint-disable-next-line<div class="row ">

    <div class="col-md-4 col-lg-4">
    <button type="button" class="btn btn-primary">Customer Login</button>
    </div>
    <div class="col-md-4 col-lg-4">
    <button type="button" class="btn btn-primary">Restuarant Login</button>
    </div>
    </div>

    </div>
  );
}

export default Home;
